css:
#pbid-ExistingEcafBlock table, th, td {
border: none;
padding:5px;
font-weight:bold;  
}
.pb-datetime{
font-size:14px;
}
.pb-detail-record{
padding: 20px 0px;
} 
.indent label{
padding-left:15px;
}
#pbid-StudentInfoDetailHECScontainer-0 label, #pbid-StudentInfoDetailFeecontainer-0 label, #pbid-StudentInfoDetailSAcontainer-0 label
{
width:250px;
}
#pbid-StudentInfoDetailHECSConfcontainer-0 label, #pbid-StudentInfoDetailFeeConfcontainer-0 label, #pbid-StudentInfoDetailSAConfcontainer-0 label,
#pbid-TFNDisplayHECSConf-container label,  #pbid-TFNDisplayFeeConf-container label, #pbid-TFNDisplayOSConf-container label, #pbid-TFNDisplaySAConf-container label
{
width:350px;
}
#pbid-EcafReceiptBlock label, #pbid-EcafSummaryDetail label{
width:200px;
}
#pbid-RequestDetailOS label{
width:450px;
}
#pbid-RequestDetailOS input, #pbid-RequestDetailOS select{
display:block;
margin-top:10px;
margin-bottom:10px;
}
#pbid-RequestDetailOS li{
margin-left:35px;
}
.indentliteral{
margin-left:35px;}
#pbid-EcafReceiptBlock .pb-detail-record, #pbid-RequestBlockHECSConf .pb-detail-record,  #pbid-RequestBlockFeeConf .pb-detail-record,  
#pbid-RequestBlockSAConf .pb-detail-record
{
padding: 0px 0px;
}
.btn-primary{
margin-top:10px;
}
#pbid-SubmitButtonHECSConf-container, #pbid-BackButtonHECSConf-container,
#pbid-SubmitButtonFeeConf-container, #pbid-BackButtonFeeConf-container,
#pbid-SubmitButtonOSConf-container, #pbid-BackButtonOSConf-container,
#pbid-SubmitButtonSAConf-container, #pbid-BackButtonSAConf-container
{
width:25%;
display:inline;
padding-left:5px;
}
.progtitle{
margin-bottom:5px;
}
#pbid-EcafSummaryDetail .pb-detail-record{
padding: 10px 0px;
}
@media only screen and (max-width : 480px) {
#pbid-StudentInfoDetailHECScontainer-0 label, #pbid-StudentInfoDetailFeecontainer-0 label, #pbid-StudentInfoDetailSAcontainer-0 label, 
#pbid-StudentInfoDetailHECSConfcontainer-0 label, #pbid-StudentInfoDetailFeeConfcontainer-0 label,  #pbid-TFNDisplayHECSConf-container label,
#pbid-TFNDisplayFeeConf-container label, #pbid-TFNDisplayOSConf-container label, #pbid-TFNDisplaySAConf-container label, #pbid-StudentInfoDetailSAConfcontainer-0 label, #pbid-EcafReceiptBlock label,#pbid-EcafSummaryDetail label
{
display:block;
margin-top:10px;
}
#pbid-StudentInfoDetailHECScontainer-0 span, #pbid-StudentInfoDetailFeecontainer-0 span, #pbid-StudentInfoDetailSAcontainer-0 span, 
#pbid-StudentInfoDetailHECSConfcontainer-0 span, #pbid-StudentInfoDetailFeeConfcontainer-0 span,  #pbid-TFNDisplayHECSConf-container span,
#pbid-TFNDisplayFeeConf-container span, #pbid-TFNDisplayOSConf-container span, #pbid-TFNDisplaySAConf-container span, #pbid-StudentInfoDetailSAConfcontainer-0 span
{
padding-left:15px; 
}
}
